import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Hospitals from './components/Hospitals'; // Create this component similarly
import Medicals from './components/Medicals';   // Create this component similarly
import Diagnostics from './components/Diagnostics'; // Create this component similarly

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/hospitals" component={Hospitals} />
          <Route path="/medicals" component={Medicals} />
          <Route path="/diagnostics" component={Diagnostics} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
